import React from 'react';

const Home = () => {
    return (
        <div className="home">
            <h1>Welcome to the Gym Management System</h1>
            <p>Your one-stop solution for managing gym memberships, sessions, payments, and more!</p>
        </div>
    );
};

export default Home;
